import { makeStyles } from '@material-ui/core/styles';
import annotationlist from '../../static/annotationlist.json';
import Grid from '@material-ui/core/Grid';

const useStyles = makeStyles((theme) => ({
    root: {
        padding: theme.spacing(2),
        height:'100%',
    },
    grid: {
        // border: 'solid'
    }
}));

const qalist = annotationlist.annotatonlist;

export default function DocInfo({ fileId }) {
    const classes = useStyles();
    const file = qalist[fileId];

    return (
        <Grid container className={classes.root} direction="row" justify="space-between">
            <Grid item xs={4} className={classes.grid} style={{borderRight:'1px solid #f5f5f5'}}>
                <div>FILE ID</div>
            </Grid>
            <Grid item xs={8} className={classes.grid}></Grid>
        </Grid>
    );
}
